import {useState} from 'react';
import Navbar from './Navbar';
import Footer from './Footer';

export const Main = () => {
    const [value, setValue] = useState();    

    const calculate  = () => {
        if(value == 'project') {
            return <Footer/>
        }
    }
    return (
        <>
        <Navbar setValue={setValue}/>
        {
            calculate()
        }

        {/* <Footer /> */}
        </>
    )
}
